import { Hex, Address, concat, encodeAbiParameters } from "viem";

export const bundleBulkerCreateCall: Hex = "";

export const entryPointCreateCall: Hex = ""

export const simpleAccountFactoryCreateCall: Hex = ""

export const perOpInflatorCreateCall = (owner: Address) => {
    return concat([
        "",
        encodeAbiParameters([{ name: 'owner', type: 'address' }], [owner])
    ])
};
